import styles from './Proper.module.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

function Proper(prop) {
    return ( 
        <>
        <div className={styles['row-menu']}>
            <FontAwesomeIcon className={styles['icon']} icon={prop.icon} />
            <p className={styles['']}>{prop.searchValue}</p>
        </div>
        </>
     );
}

export default Proper;
